import React, { Fragment, useState } from "react";
import { Link } from "react-router-dom";
import "../css/header.css";
import logo from "../brainster_space_logo.svg";

const Header = () => {
  const [spaceBlog, setSpaceBlog] = useState(false);
  const [nastani, setNastani] = useState(false);
  const [working, setWorking] = useState(false);
  const [akademii, setAkademii] = useState(false);
  const [prostor, setProstor] = useState(false);
  const [partnerstva, setPartnerstva] = useState(false);
  const [ menu, setMenu ]= useState(true);
  const showMenu = () => {
    setMenu(!menu);
  }
  const yelow = () => {
    setSpaceBlog(true);
    setNastani(false);
    setWorking(false);
    setAkademii(false);
    setProstor(false);
    setPartnerstva(false);
  };
  const yelow1 = () => {
    setSpaceBlog(false);
    setNastani(true);
    setWorking(false);
    setAkademii(false);
    setProstor(false);
    setPartnerstva(false);
  };
  const yelow0 = () => {
    setSpaceBlog(false);
    setNastani(false);
    setWorking(true);
    setAkademii(false);
    setProstor(false);
    setPartnerstva(false);
  };
  const yelow2 = () => {
    setSpaceBlog(false);
    setNastani(false);
    setWorking(false);
    setAkademii(true);
    setProstor(false);
    setPartnerstva(false);
  };
  const yelow3 = () => {
    setSpaceBlog(false);
    setNastani(false);
    setWorking(false);
    setAkademii(false);
    setProstor(true);
    setPartnerstva(false);
  };
  const yelow4 = () => {
    setSpaceBlog(false);
    setNastani(false);
    setWorking(false);
    setAkademii(false);
    setProstor(false);
    setPartnerstva(true);
  };
  return (
    <Fragment>
      <div className="header">
        <div className="l-l">
          <Link to="/">
            <div className="logo">
              <img src={logo}></img>
            </div>
          </Link>
          <div className={menu ? "navs d-none" : "d-none"}>
            <ul>
              <Link to="/space-blog">
                <li
                  onClick={yelow}
                  className={spaceBlog ? "yelowUnderline" : null}
                >
                  SPACE БЛОГ
                </li>
              </Link>
              <li
                onClick={yelow1}
                className={nastani ? "yelowUnderline" : null}
              >
                НАСТАНИ
              </li>
              <li
                onClick={yelow0}
                className={working ? "yelowUnderline" : null}
              >
                CO-WORKING
              </li>
              <Link to="/akademii">
                <li
                  onClick={yelow2}
                  className={akademii ? "yelowUnderline" : null}
                >
                  АКАДЕМИИ
                </li>
              </Link>
              <Link to="/prostor-za-nastani">
                <li
                  onClick={yelow3}
                  className={prostor ? "yelowUnderline" : null}
                >
                  ПРОСТОР ЗА НАСТАНИ
                </li>
              </Link>
              <li
                onClick={yelow4}
                className={partnerstva ? "yelowUnderline" : null}
              >
                ПАРТНЕРСТВА
              </li>
            </ul>
          </div>
        </div>
        <div className="prikluci">
          <ul>
            <Link to="/form">
              <li>
                <span>
                  <i class="fa fa-plus" aria-hidden="true"></i>
                </span>
                ПРИКЛУЧИ СЕ
              </li>
            </Link>
          </ul>
        </div>
        <div className="menu-hamburger" onClick={showMenu}><i class="fa fa-bars" aria-hidden="true"></i></div>
      </div>
      <div className={spaceBlog ? "showCategorii" : "hideCategorii"}>
        <ul>
          <li>ФЛИЛТРИРАЈ</li>
          <li>СИТЕ</li>
          <li>КАРИЕРА</li>
          <li>ТЕХНОЛОГИЈА</li>
          <li>DATA SCIENCE</li>
          <li>МАРКЕТИНГ</li>
          <li>ДИЗАЈН</li>
          <li>IMPACT</li>
         <a href="https://medium.com/wearelaika/brainster-space-the-new-home-of-the-local-tech-community-in-skopje-ffe97b564152">
         <li>#SpaceFamily</li>
           </a>
        </ul>
      </div>
    </Fragment>
  );
};

export default Header;
